import React from "react";

function ProductCard(props) {
  return (
        <div className="border mb-4 rounded overflow-hidden">
           <div style={{'backgroundImage' : `url('${props.product.image[0].images}')`,}} className="w-full h-64 bg-blue bg-cover">

           </div>

            {props.product.name}
            {props.product.price}
        </div>
  );
}

export default ProductCard;
